import React from 'react';
import { MDBBtn, MDBCard, MDBCardBody, MDBCardImage, MDBCardTitle, MDBCardText, MDBCol } from 'mdbreact';
import band from './alebhia.jpg';
import './cards.css';

const Alebhia = () => {
  return (
    <MDBCol className="mb-r" style={{marginTop:"1rem"}}>
      
      <MDBCard style={{ width: "15rem",background:"black"}}>
        
        <MDBCardBody className="zoom">
          <img src={band} style={{width:"50%",margin:"1rem"}}></img>
         <br/>
          <MDBCardText style={{color:"whitesmoke"}}>
            Nilesh
          </MDBCardText>
        
        </MDBCardBody>
      </MDBCard>
    </MDBCol>
  )
}

export default Alebhia;
